import React, { useState, useEffect } from 'react';
import './styles.css';

function App() {
  const [state, setState] = useState('Delhi');
  const [weatherData, setWeatherData] = useState(null);
  const [yesterdayWeather, setYesterdayWeather] = useState(null);
  const [tomorrowWeather, setTomorrowWeather] = useState(null);
  const [error, setError] = useState('');

  const states = [
    "Delhi", "Mumbai", "Chennai", "Kolkata", "Bengaluru", "Hyderabad", "Ahmedabad", 
    "Pune", "Jaipur", "Surat", "Lucknow", "Kanpur", "Nagpur", "Visakhapatnam", 
    "Bhopal", "Patna", "Ludhiana", "Agra", "Nashik", "Vadodara", "Faridabad", 
    "Meerut", "Rajkot", "Varanasi", "Srinagar", "Aurangabad", "Dhanbad", 
    "Amritsar", "Navi Mumbai", "Allahabad"
  ];

  useEffect(() => {
    fetchWeatherData();
    fetchYesterdayWeather();
    fetchTomorrowWeather();
  }, [state]);

  const fetchWeatherData = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/weather/${state}`);
      if (!response.ok) {
        throw new Error('Failed to fetch weather data.');
      }
      const data = await response.json();
      setWeatherData(data);
    } catch (error) {
      setError(error.message);
      setWeatherData(null);
    }
  };

  const fetchYesterdayWeather = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/weather/yesterday/${state}`);
      if (!response.ok) {
        throw new Error('Failed to fetch yesterday\'s weather data.');
      }
      const data = await response.json();
      setYesterdayWeather(data);
    } catch (error) {
      setError(error.message);
      setYesterdayWeather(null);
    }
  };

  const fetchTomorrowWeather = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/weather/tomorrow/${state}`);
      if (!response.ok) {
        throw new Error('Failed to fetch tomorrow\'s weather data.');
      }
      const data = await response.json();
      setTomorrowWeather(data);
    } catch (error) {
      setError(error.message);
      setTomorrowWeather(null);
    }
  };

  return (
    <div className="app-container">
      <div className="dynamic-box">
        <h1 className="dynamic-text">Weather App</h1>
        
        <div>
          <label>Select State: </label>
          <select className="state-select" value={state} onChange={(e) => setState(e.target.value)}>
            {states.map((stateName) => (
              <option key={stateName} value={stateName}>
                {stateName}
              </option>
            ))}
          </select>
        </div>
        
        {error && <p className="error-text">{error}</p>}
        
        {weatherData && (
          <div className="weather-info">
            <h2>Current Weather in {state}</h2>
            <p>Temperature: {weatherData.temperature}°C</p>
            <p>Chance of Rain: {weatherData.chanceOfRain}%</p>
          </div>
        )}

        {yesterdayWeather && (
          <div className="weather-info">
            <h2>Yesterday's Weather in {state}</h2>
            <p>Temperature: {yesterdayWeather.temperature}°C</p>
            <p>Chance of Rain: {yesterdayWeather.chanceOfRain}%</p>
          </div>
        )}

        {tomorrowWeather && (
          <div className="weather-info">
            <h2>Tomorrow's Weather in {state}</h2>
            <p>Temperature: {tomorrowWeather.temperature}°C</p>
            <p>Chance of Rain: {tomorrowWeather.chanceOfRain}%</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
